# Ensure grid points are reshaped properly for face generation
def spherical_grid_mesh(n_theta=200, n_phi=100):
    theta = np.linspace(0, 2 * np.pi, n_theta)
    phi = np.linspace(0, np.pi, n_phi)
    Theta, Phi = np.meshgrid(theta, phi)

    x = np.sin(Phi) * np.cos(Theta)
    y = np.sin(Phi) * np.sin(Theta)
    z = np.cos(Phi)

    points = np.vstack([x.ravel(), y.ravel(), z.ravel()]).T

    # Generate faces explicitly (quad mesh converted to triangles)
    faces = []
    for i in range(n_phi - 1):
        for j in range(n_theta - 1):
            p0 = i * n_theta + j
            p1 = p0 + 1
            p2 = p0 + n_theta
            p3 = p2 + 1
            # Two triangles per quad
            faces.extend([3, p0, p2, p1])  # Triangle 1
            faces.extend([3, p1, p2, p3])  # Triangle 2

    faces = np.array(faces)
    return points, faces, Theta, Phi

# Generate spherical mesh
points, faces, Theta, Phi = spherical_grid_mesh(n_theta=200, n_phi=100)

