def cartesian_to_spherical(vectors):
    vectors = vectors / np.linalg.norm(vectors, axis=1, keepdims=True)
    x, y, z = vectors[:, 0], vectors[:, 1], vectors[:, 2]

    azimuth = np.arctan2(y, x)
    azimuth = np.mod(azimuth, 2*np.pi)

    altitude = np.arcsin(z)
    altitude = np.mod(altitude, 2*np.pi)

    return azimuth, altitude

def polar_histogram(ax, angles, bins=180, label=None, color=None):
    hist, bin_edges = np.histogram(angles, bins=bins, range=(0, 2*np.pi))
    widths = np.diff(bin_edges)
    ax.bar(bin_edges[:-1], hist, width=widths, align='edge', edgecolor=color or 'C0',
           fill=False, linewidth=1.5, label=label)
    return angles  # for stats

def draw_mean_and_std(ax, angles, radius=1.0, color='black', label=None, corner="bottomright"):
    mean = np.angle(np.mean(np.exp(1j * angles))) % (2*np.pi)
    std = np.std(angles)

    # Draw arrow
    ax.annotate('', xy=(mean, radius), xytext=(0, 0),
                arrowprops=dict(facecolor=color, shrink=0.05, width=2),
                label=label)

    # Draw ±std line
    ax.plot([mean - std, mean + std], [radius, radius], color=color, linestyle='dashed')

    # Text content
    mean_deg = np.rad2deg(mean)
    std_deg = np.rad2deg(std)
    text = f"μ = {mean_deg:.1f}°\nσ = {std_deg:.1f}°"

    # Use fixed angle and fixed *relative* radial distance from max
    if corner == "bottomright":
        theta = np.deg2rad(335)
    elif corner == "bottomleft":
        theta = np.deg2rad(205)
    else:
        theta = np.deg2rad(335)

    # Get current max radius from plot and place text at a constant relative distance
    r_max = ax.get_rmax()
    text_radius = r_max * 1.45  # adjust multiplier as needed

    ax.text(theta, text_radius, text,
            ha='center', va='center',
            fontsize=8, color=color,
            bbox=dict(boxstyle="round,pad=0.3", facecolor='white',
                      edgecolor=color, linewidth=0.5, alpha=0.8))

def draw_angular_difference(ax, angles_A, angles_B, corner="top"):
    # Compute circular means
    mean_A = np.angle(np.mean(np.exp(1j * angles_A))) % (2*np.pi)
    mean_B = np.angle(np.mean(np.exp(1j * angles_B))) % (2*np.pi)

    # Angular difference
    mean_diff = np.abs((mean_A - mean_B + np.pi) % (2*np.pi) - np.pi)
    mean_diff_deg = np.rad2deg(mean_diff)

    # Circular stds
    R_A = np.abs(np.mean(np.exp(1j * angles_A)))
    R_B = np.abs(np.mean(np.exp(1j * angles_B)))
    std_A = np.sqrt(-2 * np.log(R_A))
    std_B = np.sqrt(-2 * np.log(R_B))

    # Z-score like separation
    pooled_std = np.sqrt((std_A**2 + std_B**2) / 2)
    z_score = mean_diff / pooled_std if pooled_std > 0 else np.inf

    # Format text
    text = f"Δμ = {mean_diff_deg:.1f}°\nz = {z_score:.2f}"

    # Position
    theta = np.deg2rad(25)  # Top
    r_max = ax.get_rmax()
    r_text = r_max * 1.45

    ax.text(theta, r_text, text,
            ha='center', va='center',
            fontsize=8, color='black',
            bbox=dict(boxstyle="round,pad=0.3", facecolor='white',
                      edgecolor='black', linewidth=0.5, alpha=0.8))

def perm_test_angles(angles_A, angles_B, n_permutations=10000):
    """
    Permutation test for angular data. Compares the angular distance between
    the circular means of two sets of angles (in radians).
    """
    n_A = len(angles_A)
    n_B = len(angles_B)

    # Compute circular means
    mean_A = np.angle(np.mean(np.exp(1j * angles_A))) % (2*np.pi)
    mean_B = np.angle(np.mean(np.exp(1j * angles_B))) % (2*np.pi)

    # Observed angular difference
    obs_diff = np.abs((mean_A - mean_B + np.pi) % (2*np.pi) - np.pi)

    # Permutation test
    pooled = np.concatenate([angles_A, angles_B])
    null_distribution = np.zeros(n_permutations)

    for i in range(n_permutations):
        permuted = np.random.permutation(pooled)
        perm_A = permuted[:n_A]
        perm_B = permuted[n_A:]

        mean_perm_A = np.angle(np.mean(np.exp(1j * perm_A))) % (2 * np.pi)
        mean_perm_B = np.angle(np.mean(np.exp(1j * perm_B))) % (2 * np.pi)

        diff = np.abs((mean_perm_A - mean_perm_B + np.pi) % (2*np.pi) - np.pi)
        null_distribution[i] = diff
        #print (f"Permutation: {i}, d:{np.rad2deg(diff)} >o:{np.rad2deg(obs_diff)} ? { diff > obs_diff}")

    p_value = np.mean(null_distribution >= obs_diff)

    print(f"🧪 Permutation Test (angles): {np.sum(null_distribution >= obs_diff)} / {n_permutations}")
    print(f"Observed angular difference: {np.rad2deg(obs_diff):.2f}°")
    print(f"P-value: {p_value:.4f}")

    return p_value

def plot_vector_angles(A, B, A_name="A", B_name="B"):
    az_A, alt_A = cartesian_to_spherical(A)
    az_B, alt_B = cartesian_to_spherical(B)

    print (A.shape)
    print (A[0])

    print (f"az_A[0] = {az_A[:10]}")
    print (f"az_B[0] = {az_B[:10]}")
    print (f"alt_A[0] = {alt_A[:10]}")
    print (f"alt_B[0] = {alt_B[:10]}")

    print ("Doing permutation test for azimuth and")
    perm_test_angles(az_A, az_B)
    print ("Doing permutation test for altitude and")
    perm_test_angles(alt_A, alt_B)

    fig, axs = plt.subplots(2, 3, subplot_kw={'projection': 'polar'}, figsize=(13, 6))

    # --- A ---
    axs[0, 0].set_title(f"Azimuth: {A_name}", va='bottom', pad=20)
    polar_histogram(axs[0, 0], az_A, color='C0')

    axs[1, 0].set_title(f"Altitude: {A_name}", va='bottom', pad=20)
    polar_histogram(axs[1, 0], alt_A, color='C0')

    # --- B ---
    axs[0, 1].set_title(f"Azimuth: {B_name}", va='bottom', pad=20)
    polar_histogram(axs[0, 1], az_B, color='C1')

    axs[1, 1].set_title(f"Altitude: {B_name}", va='bottom', pad=20)
    polar_histogram(axs[1, 1], alt_B, color='C1')

    # --- Overlap ---
    axs[0, 2].set_title("Azimuth Overlap", va='bottom', pad=20)
    polar_histogram(axs[0, 2], az_A, label=A_name, color='C0')
    polar_histogram(axs[0, 2], az_B, label=B_name, color='C1')
    # axs[0, 2].legend(loc='lower center', bbox_to_anchor=(1.3, 0.0), fontsize=9)

    axs[1, 2].set_title("Altitude Overlap", va='bottom', pad=20)
    polar_histogram(axs[1, 2], alt_A, label=A_name, color='C0')
    polar_histogram(axs[1, 2], alt_B, label=B_name, color='C1')
    axs[1, 2].legend(loc='lower center', bbox_to_anchor=(1.3, -0.3), fontsize=9)
    
    # A
    draw_mean_and_std(axs[0, 0], az_A, color='C0', corner="bottomright")
    draw_mean_and_std(axs[1, 0], alt_A, color='C0', corner="bottomright")

    # B
    draw_mean_and_std(axs[0, 1], az_B, color='C1', corner="bottomright")
    draw_mean_and_std(axs[1, 1], alt_B, color='C1', corner="bottomright")

    # Overlap
    draw_mean_and_std(axs[0, 2], az_A, color='C0', corner="bottomleft")
    draw_mean_and_std(axs[0, 2], az_B, color='C1', corner="bottomright")

    draw_mean_and_std(axs[1, 2], alt_A, color='C0', corner="bottomleft")
    draw_mean_and_std(axs[1, 2], alt_B, color='C1', corner="bottomright")

    # Angular difference
    draw_angular_difference(axs[0, 2], az_A, az_B)
    draw_angular_difference(axs[1, 2], alt_A, alt_B)

    plt.tight_layout()
    plt.show()

# 🔥 Run with names
plot_vector_angles(A, B, A_name=A_name, B_name=B_name)
